import React, {useState} from 'react';
import { history } from  './../../helpers';
import {
  CCard,
  CCardBody,
  CCol,
  CRow,
  CImg,
} from '@coreui/react';

import 'react-table-v6/react-table.css';
import './../../scss/danhmucduan.css'

const colorTranthaiDuAn = (trangThaiDuAn) => {
  var styleTrangThaiDuAn = "";
  switch (trangThaiDuAn) {
    case 0:
      styleTrangThaiDuAn ={
        textAlign: "left",
        fontFamily: "Roboto",
        fontStyle: "normal",
        fontWeight: "bold",
        fontSize: "20px",
        color: "rgba(219,197,0,1)"
      };
      break
    case 1:        styleTrangThaiDuAn ={
            textAlign: "left",
            fontFamily: "Roboto",
            fontStyle: "normal",
            fontWeight: "bold",
            fontSize: "20px",
            color: "rgba(219,197,0,1)"
          };

      break;
    default:
      styleTrangThaiDuAn = "Hỗ trợ";
  }
  return styleTrangThaiDuAn;
}

export default function FormDuAn (props) {
  const [dataImage, setdataImage] = useState('data:image/png;base64,');
  const [thongTinDuAn, setthongTinDuAn] = useState({
    ten_du_an: props.ten_du_an,
    truong_du_an: props.truong_du_an,
    chuc_vu: props.chuc_vu,
    trangThaiDuAn: props.trang_thai_du_an,
    nhomDichVu: props.nhom_dich_vu,
    dataImageUri: ""
  });
  const btnChithietonClick = (e) =>
  {
    history.push("/dmduan/danhsach/chitiet");
  }
    return (
      <div>
      <CCard>
          <CCardBody>
            <CRow className ="info_formduan">
              <CCol md="4" className ="form_logo">
                <CImg
                  src = {dataImage}
                  className = "logo_duan"
                />
              </CCol>
              <CCol md="8" >
                <div  className ="info_dong">
                    Tên dự án: <span className="info_tendonvi ">  {thongTinDuAn.ten_du_an} </span>
                </div>
                <div className ="info_dong">
                  Trưởng dự án: <span className="info_tendonvi"> {thongTinDuAn.truong_du_an} </span> - {thongTinDuAn.chucVu}
                </div>
                <div className ="info_dong">
                  Trạng thái: <span style ={colorTranthaiDuAn(0)}>  {thongTinDuAn.trangThaiDuAn}</span>
                </div>
                <div className ="info_nhomdichvu">
                   Nhóm dịch vụ: <span>{thongTinDuAn.nhomDichVu} </span>
                </div>
                <div className ="info_nhomdichvu">
                  <button onClick = {btnChithietonClick }type="button">Chi tiết dự án!</button>
                </div>
              </CCol>
              </CRow>
          </CCardBody>
        </CCard>
      </div>
    )
}
